import React, { Component, Fragment } from 'react';
import Mynav from '../component/route/MyNav';

class Newabout extends Component{
    constructor(){
        super()
        this.state = {
            MyName: ''
        }
    }

    render (){
        return (
            <Fragment>
                <div>
                    <Mynav/>
                    <h1>New About Page</h1>
                    <h2>{this.state.MyName}</h2>
                </div>
            </Fragment>
        )
    }
}
export default Newabout;
